
public class SwitchBreak {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int n = 24;
		
		switch(n){
		
		case 0 : case 10:
			System.out.println("0~10");
		break;
		
		case 11 : case 20 :
			System.out.println("11~20");

		default :
			System.out.println("21 »ף");
		
		}
		
		
	}

}
